import React, { useState } from 'react';
import './Projects.css';

const Projects = () => {
  const [expandedProject, setExpandedProject] = useState(null);

  const projects = [
    {
      id: 'nlp',
      title: 'SubjECTive-QA Dataset',
      category: 'NLP Research',
      icon: '∑',
      tech: ['Python', 'NLP', 'Machine Learning', 'Research'],
      description: 'Contributed to NeurIPS dataset for subjective question answering, advancing the field of contextual language understanding.',
      details: 'This research project involved developing a comprehensive dataset for subjective question answering, contributing to the advancement of NLP models that can understand and respond to subjective queries with contextual awareness.',
      links: {
        demo: '#',
        github: '#'
      }
    },
    {
      id: 'finance',
      title: 'Language Modeling for Finance',
      category: 'FinTech',
      icon: '∫',
      tech: ['Python', 'Finance', 'Deep Learning', 'NLP'],
      description: 'Developed language models specifically tailored for financial text analysis and market prediction.',
      details: 'Created specialized language models that understand financial terminology and context, enabling better analysis of market sentiment and financial document processing.',
      links: {
        demo: '#',
        github: '#'
      }
    },
    {
      id: 'trading',
      title: 'Quantitative Trading Engine',
      category: 'Algorithmic Trading',
      icon: 'λ',
      tech: ['Python', 'Quantitative Finance', 'Machine Learning'],
      description: 'Built algorithmic trading system using mathematical models and machine learning for market analysis.',
      details: 'Developed a sophisticated trading engine that combines mathematical modeling with machine learning algorithms to identify market opportunities and execute trades automatically.',
      links: {
        demo: '#',
        github: '#'
      }
    },
    {
      id: 'differential',
      title: 'FIdent: Differential Equations',
      category: 'Mathematical Modeling',
      icon: '∂',
      tech: ['Mathematical Modeling', 'Python', 'Research'],
      description: 'Research on differential equation identification and solving using computational methods.',
      details: 'Advanced research in computational methods for identifying and solving complex differential equations, with applications in mathematical modeling and scientific computing.',
      links: {
        demo: '#',
        github: '#'
      }
    },
    {
      id: 'attribution',
      title: 'Mutual Fund Attribution Model',
      category: 'Financial Analysis',
      icon: 'π',
      tech: ['Finance', 'Data Analysis', 'Python'],
      description: 'Developed attribution models for analyzing mutual fund performance and risk factors.',
      details: 'Created comprehensive attribution models that decompose mutual fund returns into various risk factors, enabling better understanding of fund performance drivers.',
      links: {
        demo: '#',
        github: '#'
      }
    },
    {
      id: 'ml-trading',
      title: 'ML Trading Strategy',
      category: 'Machine Learning',
      icon: 'Σ',
      tech: ['Machine Learning', 'Trading', 'Python'],
      description: 'Machine learning-based trading strategy with risk management and portfolio optimization.',
      details: 'Developed sophisticated ML trading strategies that incorporate risk management principles and portfolio optimization techniques for enhanced trading performance.',
      links: {
        demo: '#',
        github: '#'
      }
    }
  ];

  const toggleProject = (projectId) => {
    setExpandedProject(expandedProject === projectId ? null : projectId);
  };

  return (
    <section id="projects" className="projects">
      <div className="mathematical-grid"></div>

      <div className="container">
        <div className="section-header">
          <h2 className="section-title">
            <span className="math-accent">∇</span>Research & Projects<span className="math-accent">∇</span>
          </h2>
          <p className="section-subtitle">Mathematical Computational Research Portfolio</p>
        </div>

        <div className="projects-grid">
          {projects.map((project) => (
            <div key={project.id} className="project-card">
              <button 
                className="project-header"
                onClick={() => toggleProject(project.id)}
              >
                <div className="project-header-content">
                  <span className="project-icon">{project.icon}</span>
                  <div className="project-header-text">
                    <h3>{project.title}</h3>
                    <p className="project-category">{project.category}</p>
                  </div>
                </div>
                <span className={`expand-icon ${expandedProject === project.id ? 'expanded' : ''}`}>+</span>
              </button>

              {expandedProject === project.id && (
                <div className="project-content">
                  <p className="project-description">{project.details}</p>

                  <div className="project-tech">
                    {project.tech.map((tech, index) => (
                      <span key={index} className="tech-tag">{tech}</span>
                    ))}
                  </div>

                  <div className="project-links">
                    <a href={project.links.demo} className="project-link demo">
                      View Research
                    </a>
                    <a href={project.links.github} className="project-link github">
                      Source Code
                    </a>
                  </div>
                </div>
              )}
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
